contracts/fundme.sol.content:
//get funds from users
//withdraw funds
// set minimum funds in usd

//SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "./priceconverter.sol";


contract Fundme{
    using priceConverter for uint256; 

    uint256 public minimumUSD = 20 * 1e18;

    address[] public funders;
    mapping(address=>uint256) public addressToAmountFunded;


    function fund() public payable {
        //set minimum funds to be sent

        require(msg.value.getConvertionRate() >= minimumUSD , "the fund sent is insufficient");
        //save addresses of funders
        funders.push(msg.sender);
        //to check address and the amount funded
        addressToAmountFunded[msg.sender] = msg.value;
        
    } 


    function withdraw() public {
        /* format is (startingpoint;endpoint; stepamount)*/
        for(uint256 funderIndex = 0; funderIndex < funders.length; funderIndex = funderIndex + 1){
            //set funders amount of the specific index to variable funder  
        address funder = funders[funderIndex];
        // set the amount to 0
        addressToAmountFunded[funder] = 0;

        }
        //reset arrays
        funders = new address[](0);

        //ways to send eth 
        //transfer
        //payable(msg.sender).transer(address(this).balance);
        //call
        (bool callsuccess,) = payable(msg.sender).call{value : address(this).balance}("");
        require(callsuccess, "call failed");

                
    }
    


    

}

contracts/priceconverter.sol.content:
 //SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library priceConverter{
    
    function getPrice() public view returns(uint256) {

        //since we using an external contract we'll need...
        //ABI
        //address= 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        (,int price,,,) = priceFeed.latestRoundData();
        return (uint256(price * 1e10));
    }

    function getConvertionRate(uint256 ethAmount) public view returns(uint256){
        uint256 ethPrice = getPrice();
        uint256 ethPriceinusd = (ethPrice * ethAmount) / 1e18;

        return ethPriceinusd;

    } 
}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

